import React, {useState, useEffect} from 'react';
import styled from '@emotion/styled';

const Wrapper = styled.div`
position: fixed;
z-index:100;
width:100%;
height:100%;
display:flex;
backdrop-filter: blur(15px);
`

const Box = styled.div`
position: sticky;
background:blue;
width:100px;
height:300px;
`

const Card = () => {
    return(
        <Wrapper>
            <Box />
        </Wrapper>
    )
}

export default Card;
